import React from 'react';
import PropTypes from 'prop-types';
import Proyectos from './Proyecto';


const Listado = props => {

    const proyectos = [
        { nombre: 'Tienda Virtual' },
        { nombre: 'Intranet' },
        { nombre: 'Diseño de sitio' }
    ]


    return (
        <ul className="listado-proyectos">
            {proyectos.map(e => (
                <Proyecto
                    proyecto={e}
                />
            ))}
        </ul>
    );
};

Listado.propTypes = {

};

export default Listado;
